import React from "react";
import { useParams } from "react-router-dom";
import { useQuery, gql } from "@apollo/client";

const GET_USER_BYID = gql`
  query User($userId: ID!) {
    user(id: $userId) {
      name
    }
  }
`;

function User() {
  const id = useParams().id;
  const {
    data: { user },
    loading,
    error,
  } = useQuery(GET_USER_BYID, {
    variables: {
      userId: id,
    },
  });
  // console.log(data);
  return (
    <div>
      <p>Name: {user.name}</p>
    </div>
  );
}

export default User;
